import React from 'react';
import Header from './Header';
export default function DashBoard(props)
{
    return(
        <div className="DashBoard">
            <Header />
            <h2>Welcome {props.name}</h2>
            <button onClick={props.Logout}>Logout</button>
        </div>
    )
}
